import React from 'react';
import ReactDOM from 'react-dom';

import {App} from './App.js';


const fname = 'jatin';
const lname = 'mishra';
const today = new Date();


ReactDOM.render(
                <>
                <h1>This is a new challenge </h1>
                <p>right now the time is {today.toLocaleDateString()}</p>
                <p>right now the time is {today.getTimezoneOffset()}</p>
                </>
                ,
                document.getElementById('root'));
